COPY public.remanga_title (id, rus_name, dir_name, img_url, manga_type, issue_year, count_chapters, description, avg_rating, count_rating, count_bookmarks) FROM stdin;
1	Всеведущий читатель	omniscient-reader	omniscient-reader/0130c65d23185690a4b0d7f4a833fe06.jpg	Манхва	2020	184	<p>&laquo;Я знаю то, что сейчас произойдёт&raquo;.Когда он подумал об этом, всё изменилось.С того момента началась игра со смертью в мире, где каждый должен сделать всё, чтобы выжить. В мире, конец которого известен только ему.</p>	6.75	4	3
5	Нуб максимального уровня	i-am-a-fulltime-newbie-exclusive	i-am-a-fulltime-newbie-exclusive/d9cf8ea470bdd2f51efdc6b127747538.jpg	Манхва	2021	130	<p>Главный герой Джин Хек &ndash; игрок и стример, единственный, кто прошёл до конца&nbsp;&laquo;Башню испытаний&raquo;.<br />\r\nКогда он увидел концовку игры, захотел бросить её. Но в тот же день &laquo;Башня испытания&raquo; стала реальностью. И главному герою не осталось ничего, кроме как показать, на что способен тот, кто знает все нюансы игры.<br />\r\n<br />\r\n&laquo;Я покажу вам, что такое настоящий задрот!&raquo;</p>	0	0	0
6	Прирождённый наёмник	the-strongest-mercenary	the-strongest-mercenary/203c75395dd09fc4c8b103bd5be067c9.jpg	Манхва	2020	166	<p>Юй Идзинь когда-то был единственным выжившим в авиакатастрофе. Чтобы выжить, он становится наёмником. Спустя 10 лет он возвращается к своей семье в родной город. Сможет ли он забыть свое прошлое и жить жизнью обычного школьника?</p>	0	0	0
