294	Операция "Истинная любовь"	operation-name-pure-love	operation-name-pure-love/194babb4fe958bef9d3ef32f5fc86d2c.jpg	Манхва	2022	88	<p>Я застала поцелуй своего парня и лучшей подруги. Невольным свидетелем поцелуя стал не кто иной, как мой одноклассник Ко Ынхёк, с которым у меня нелучшие отношения. Я в полном замешательстве&hellip; Количество любви, которое получает каждый человек за всю жизнь, как-то предопределено?? И у меня это количество равно нулю??? План &laquo;измена&raquo; с участием бедной Суэ, которая пытается изменить свою судьбу и Ынхёка, который впутался в это дело! Они лишь собирались сделать вид, что изменяют, но это постепенно перерастает во что-то большее?! Этот план&hellip; ведь сработает?</p>	0	0	0
295	Возрождение мага восьми кругов	the-rebirth-of-an-8thcircled-mage	the-rebirth-of-an-8thcircled-mage/6484b0f77eb50a88aeff7229866df8bf.jpg	Манхва	2020	152	<p>Герой, спасший целый континент Верховный архимаг восьми кругов Генри Морис. После смерти императора Сондэ, с которым он был близок, аристократы превратили сына императора в марионетку, а он был казнён за измену. Уже умирая, в момент, когда все должно было закончиться, он перемещается в тело слабого и, по всей видимости, ленивого сына барона по имени &quot;Генри&quot;. Теперь великий маг восьми кругов станет мастером меча! Роскошная и жестокая месть Генри начинается сейчас!</p>	0	0	0
296	Только троньте моего братика, и всем вам конец	if-you-touch-my-brother-you-are-all-dead	if-you-touch-my-brother-you-are-all-dead/00c4ba97140eac60fcba9c6e7362ad34.jpg	Манхва	2021	74	<p>Я стала шестнадцатилетней Розалитой.Свалившись с кровати и открыв глаза, я обнаружила себя в классической сумасшедшей, страстной, но утомляющей BL новелле &laquo;Астерион голубого звёздного неба&raquo;. Из всех возможных вариантов, я стала старшей сестрой главного героя Астериона, которому суждено покончить жизнь самоубийством.</p>\r\n\r\n<p>Я решила просто плыть по течению и дойти так до финала новеллы, но стоило этому произойти, меня вернуло обратно в тело Розалиты.</p>\r\n\r\n<p>Поскольку прошлое решение было неверным, во второй раз я попробовала растить своего братика в любви, но и на этот раз он погиб, пусть и не по своей воле. Я же вновь вернулась к началу.</p>\r\n\r\n<p>Тогда я попробовала совершенно другую тактику &ndash; сфокусироваться не на брате, а на самой себе. Но и это не помогло. Я переродилась, даже обучившись магии, прямо во время написания моего выпускного диплома в башне.</p>\r\n\r\n<p>А раз я постоянно возвращаюсь в тело Розалиты Роксбог, стоит попробовать найти способ для собственной красивой смерти.</p>	0	0	0
48	Почтенный бессмертный Ло Вуцзи	xianzun-luo-wuji	xianzun-luo-wuji/f5d1e757dc5388e80fc5fa95fe0eb647.jpg	Маньхуа	2021	247	<p>Бессмертный Ло Вуцзи, возрождается в наше время, когда он еще был подростком.</p>	8	1	1
2	Пик боевых искусств	martial_peak	martial_peak/56169d91c6668d8ab647b3c781e453fc.jpg	Маньхуа	2018	3631	<p>На основе одноименного романа. Путь на вершину боевых искусств - путь одинокий и длинный. Перед лицом невзгод ты должен оставаться сильным и неотступным. Только тогда ты сможешь преодолеть все препятствия и стать по-настоящему сильным. Небесная Башня обучает своих учеников самым суровым образом, чтобы они могли выстоять в мире боевых искусств. Но только из-за одного самого незначительного проступка наш главный герой, Ян Кай, может быть исключен из Небесной Башни.</p>	8	1	0
12	Возрождение Хуашань	return-volcano	return-volcano/652ceac5b9d286d3df09fd99e1103283.jpg	Манхва	2021	102	<p>13-й ученик великой школы Хуашань, один из трех величайших фехтовальщиков в мире - благородный клинок цветущей сливы Чхон Мён.<br />\r\nПоследним ударом клинка он убивает Чхонма, повергшего весь мир в хаос, и погибает на вершине горы из голов тысячи демонов.<br />\r\nА спустя 100 лет он перерождается в теле ребенка, чтобы возродить из пепла некогда одну из самых великих, но ныне всеми забытую школу Мурима - Хуашань.<br />\r\nЦветки сливы рано или поздно опадают. Однако когда приходит холодная зима, а за ней - весна, слива распускается в своем полном великолепии.</p>	0	0	1
